import React from "react";
import styled from "styled-components";



const CompletedDiv = styled.div`{
cursor: pointer;
color: ${props => props.complete ? "black" : "white"};
}`


const Track = ({ track, handleToggle }) => {

  const handleClick = (e) => {
    e.preventDefault()
    handleToggle(e.currentTarget.id)
    console.log(track.status)
  }
  return (
    <>
      <CompletedDiv
        id={track.id}
        name="track"
        value={track.id}
        onClick={handleClick}
        complete={track.status}
      >
        {track.title}
      </CompletedDiv >
      {track.status.map(status =>
        <div>{status.complete}</div>)}
    </>
  );



};

export default Track;
